import './App.css';
import { Layout,Header,Sider,Content } from 'antd';
// import Header from './components/Header';
import Nav from './components/Nav';
function App() {
  return (
    <Layout>
      <Header>Header</Header>
      <Layout>
        <Sider>Sider</Sider>
        <Content>Content</Content>
      </Layout>
    </Layout>
  );
}

export default App;
